import React from 'react';
import Header from './Header/header'
import AppMain from './HomePage/appMain';
import About from './AboutPage/about'
import "./App.css"

function App() {
  return (
    <div className="App">
      <Header/>
      <AppMain/>
      <About/>
    </div>
  );
}

export default App;
